  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:28.229945\",\n\t\"name\": \"2009-annual-narrative-report-seney-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seney
  National Wildlife Refuge, Michigan Islands National Wildlife Refuge, Harbor Island
  National Wildlife Refuge, Huron Islands National Wildlife Refuge, and Kirtlandu2019s
  Warbler National Wildlife Refuge summarizes activities during the 2009 calendar
  year. The report begins with a summary of the yearu2019s highlights and climatic
  conditions. Land acquisition is also covered. The report includes a planning section
  which discusses the master plan, the management plan, public participation, compliance
  with environmental and cultural resource mandates, research, and investigations.
  Refuge administration is outlined; information about personnel, personnel programs,
  volunteer programs, funding, and safety is given. Habitat management is also covered.
  Subjects include wetlands, forests, grasslands, haying, fire management, pest control,
  wilderness areas, FmHA easements, and private lands. The wildlife section of the
  report discusses wildlife diversity, endangered species, threatened species, waterfowl,
  marsh birds, waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  surplus animal disposal, animal control, marking, banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive exhibits, hunting, fishing, trapping, wildlife observation, and law
  enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, computer systems, and energy conservation.\",\n\t\"license_title\":
